  `employee_id` int(11) DEFAULT NULL,
  `timeoff_type_id` int(11) DEFAULT NULL COMMENT 'if timeoff_type is counted by days from_date & to_date columns are selected (from_time & to_time columns will not selected)\nif timeoff_type is counted by time from_date & from_time & end_time columns are selected (to_date column will not selected)',
  `from_date` date DEFAULT NULL,
  `to_date` date DEFAULT NULL,
  `ended_date` date DEFAULT NULL COMMENT 'timeoff ended date will be selected',
  `from_time` time DEFAULT NULL,
  `end_time` time DEFAULT NULL,
  `ended_time` time DEFAULT NULL COMMENT 'if timeofee_type is counted by time ended_time column is selected',
  `timeoff_duration` float DEFAULT NULL COMMENT 'if timeoff_type_id is counted by day count one day work hour from hr_employee_schedule table day_work_hour\nif timeoff_type_id is counted by time then timeoff duration time is filled in this column',
  `status_id` int(11) DEFAULT NULL COMMENT '1 - active (if approval is needed approved status)\n2 - ended on time\n3 - ended not on time\n4 - ended before time\n5 - if approval is needed approval requesting state (if approves status_id to 1)',
  `description` text CHARACTER SET utf8 DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL COMMENT 'created user_id is filled in this column',
  `approval_status` tinyint(2) DEFAULT 0 COMMENT '2 - rejected\n1 - approved\n0 - approval pending',
  `approved_user_id` int(11) DEFAULT NULL COMMENT 'if approval needed approved user_id is filled in this column',
  `company_id` int(11) DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=latin1;

