(7313,'2020-11-18 12:42:28','202.126.89.40','saruul','hab_osol','edit','---Keys\r\nid : 7\r\n---Fields\r\ntailan_num [old]: 20201117007\r\ntailan_num [new]: 20201117001\r\nognoo [old]: 2020-11-17 00:00:00\r\nognoo [new]: 2020-11-17 12:10:00\r\n7 [old]: \r\n7 [new]: +\r\n60 [old]: \r\n60 [new]: +\r\n59 [old]: \r\n59 [new]: +\r\nhab_ajiltan [old]: \r\nhab_ajiltan [new]: Бүрэн бус техник хэрэгсэлтэй ажилд гарахгүй байх, замын нөхцөл байдалд үргэлж тохируулан явах.\r\nshuud_shaltgaan [old]: \r\nshuud_shaltgaan [new]: Замын байдал эфель зөөж мөстсөн.\r\ntailbar [old]: \r\ntailbar [new]: 2020 оны 11-р сарын 17-ны өдөр 12 цагын үед шугамнаас эфель тээвэрлэж Жалга-3-руу тээвэр хийж байх үедээ өгсөж яваад гулгаатай зам дээр буцаж алдан хөмсөг мөргөн хажуулдсан. Буцаж алдах үед машины хий дуусаж тормоз бариагүй мөн машин унтарч жолоодох боломжгүй болсон учир хөмсөг мөргөсөн болно.\r\nnomore [old]: \r\nnomore [new]: Хальтаргаа үүсэж аюултай нөхцөл ащбайдал үүссэн\r\nuridchilan_sergiileh_sanal [old]: \r\nuridchilan_sergiileh_sanal [new]: Хүйтэн болж гадаа зам хөлдсөн байгаа тул устай эфель хол тээвэрлэхгүй байх замын халлтаргаа гулгаатай өгсүүр хэсгийг услахгүй бүх машины тормозыг сайтар шалгаж тээвэр хийх шаардлагатай байна. \r\n'),
