(1,1,'Test employee order','XH012021-024','<p style=\"text-align:center\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\"><img alt=\"\" src=\"http://emine/resources/ck_files/images/default.png\" style=\"height:50px; width:250px\" /></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:22px\"><span style=\"color:#2c3e50\"><span style=\"font-family:Times New Roman,Times,serif\"><strong>&quot;ТЕСТ БАЙГУУЛЛАГА&quot; ХХК</strong></span></span></span><br />\r\n<span style=\"font-size:22px\"><strong><span style=\"color:#2c3e50\"><span style=\"font-family:Times New Roman,Times,serif\">ТУШААЛ</span></span></strong></span></p>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:33%\">$TUSHAAL_DATE</td>\r\n			<td style=\"text-align:center; width:34%\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Дугаар&nbsp;$TUSHAAL_NUMBER</span></span></td>\r\n			<td style=\"text-align:right; width:33%\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Улаанбаатар хот</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#2c3e50\"><span style=\"font-family:Times New Roman,Times,serif\"><span style=\"font-size:16px\"><strong>Түр ажилд томилох тухай</strong></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">&nbsp; &nbsp; &nbsp; &nbsp;Монгол Улсын Хөдөлмөрийн тухай хуулийн 23 дугаар зүйлийн 23.2.1 дэх заалт, 24 дүгээр зүйлийн 24.1 дэх заалт, Хөдөлмөрийн дотоод журмын гурав дугаар зүйлийн 3.1.2 , 3.1.4 &nbsp;дахь заалтыг тус тус үндэслэн ТУШААХ нь:</span></span></p>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Нэг. $REGID тоот регистрийн дугаартай $LASTNAME овогтой $FIRSTNAME-г $JOB_POSITION&nbsp;албан тушаалд $YEAR оны $MONTH дугаар сарын $DAY-ний өдрөөс эхлэн тус албан тушаалд 1 сарын туршилтын хугацаанд түр ажилтнаар томилсугай.</span></span></p>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Хоёр. $NAME-г албан тушаалд томилсонтой холбогдуулан түүнтэй хөдөлмөрийн гэрээ байгуулах, холбогдох ажлын байрны тодорхойлолтыг танилцуулахыг Захиргаа, Ерөнхий&nbsp;менежер / И.Мөнхбадрах /-д даалгасугай.</span></span></p>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Гурав. Хөдөлмөрийн хөлсийг уг албан тушаалын зэрэглэлд тогтоосны дагуу тооцон бодож олгохыг ерөнхий нягтлан бодогч / О.Энхтуяа /-д зөвшөөрсүгэй.</span></span></p>\r\n\r\n<p style=\"margin-left:40px; text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Дөрөв. Энэхүү тушаалын хэрэгжилтэд хяналт тавьж ажиллахыг Захиргаа, Ерөнхий&nbsp;менежер / И.Мөнхбадрах /-д үүрэг болгосугай.</span></span></p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:justify\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">ГҮЙЦЭТГЭХ ЗАХИРАЛ&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;С.БАТДЭЛГЭР</span></span></p>\r\n',1,NULL,'2021-02-21 16:31:39'),
(2,1,'Main employee order','XH012021-022','<p style=\"text-align:center\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\"><img alt=\"\" src=\"http://emine/resources/ck_files/images/default.png\" style=\"height:50px; width:250px\" /></span></span></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:22px\"><span style=\"color:#2c3e50\"><span style=\"font-family:Times New Roman,Times,serif\"><strong>&quot;ТЕСТ БАЙГУУЛЛАГА&quot; ХХК</strong></span></span></span><br />\r\n<span style=\"font-size:22px\"><strong><span style=\"color:#2c3e50\"><span style=\"font-family:Times New Roman,Times,serif\">ТУШААЛ</span></span></strong></span></p>\r\n\r\n<table style=\"width:100%\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:33%\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">$TUSHAAL_DATE</span></span></td>\r\n			<td style=\"text-align:center; width:34%\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Дугаар&nbsp;$TUSHAAL_NUMBER</span></span></td>\r\n			<td style=\"text-align:right; width:33%\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">Улаанбаатар хот</span></span></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p style=\"text-align:center\">&nbsp;</p>\r\n\r\n<p style=\"text-align:center\"><span style=\"color:#2c3e50\"><span style=\"font-family:Times New Roman,Times,serif\"><span style=\"font-size:16px\"><strong>Жинхлэн ажиллуулах тухай</strong></span></span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:16px\"><span style=\"font-family:Times New Roman,Times,serif\">&nbsp; &nbsp; &nbsp; &nbsp;Монгол Улсын Хөдөлмөрийн тухай хуулийн 23 дугаар зүйлийн 23.2.1 дэх заалт, 24 дүгээр зүйлийн 24.1 дэх заалт, Хөдөлмөрийн дотоод журмын гурав дугаар зүйлийн 3.1.2 , 3.1.4 &nbsp;дахь заалтыг тус тус үндэслэн ТУШААХ нь:</span></span></p>\r\n\r\n<p style=\"margin-left:40px; text-align:justif